import Head from "next/head";

const Home = () => {
  return (
    <div className="home">
      <Head>
        <title>M&M</title>
      </Head>
      <style jsx>{`
        .container {
          max-width: 1300px !important;
        }
      `}</style>
    </div>
  );
};

export default Home;
